// ==UserScript==
// @name         WME Delete House Numbers
// @namespace    https://greasyfork.org/en/scripts/
// @version      1.4
// @description  Deletes all house numbers for the selected street segment(s) in WME
// @icon         data:image/png;base64,
// @author       N190392
// @match        https://*.waze.com/*editor*
// @grant        none
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/559243/WME%20Delete%20House%20Numbers.user.js
// @updateURL https://update.greasyfork.org/scripts/559243/WME%20Delete%20House%20Numbers.meta.js
// ==/UserScript==

(function () {
    'use strict';

    /*****************************************************************
     * DELETE LOGIC
     *****************************************************************/
    function deleteHouseNumbers() {
        try {
            const selected = W.selectionManager.getSelectedFeatures();

            if (!selected || !selected.length) {
                alert('No street segment selected!');
                return;
            }

            let total = 0;
            const segIds = [];

            selected.forEach(f => {
                const model = f.model || f;
                if (model.type === 'segment' || model.featureType === 'segment') {
                    segIds.push(model.id || model.attributes?.id);
                }
            });

            if (!segIds.length) {
                alert('No segments selected!');
                return;
            }

            const allHNs = W.model.segmentHouseNumbers.getObjectArray();

            const deleteButtons = document.querySelectorAll(
                '.house-number .delete-button'
            );

            if (!deleteButtons.length) {
                alert(
                    'House numbers are not visible.\n\nZoom in until house numbers appear, then try again.'
                );
                return;
            }

            deleteButtons.forEach((btn, i) => {
                setTimeout(() => btn.click(), i * 40);
                total++;
            });

            setTimeout(() => {
                alert(` Deleted ${total} house number(s)\n\nRemember to SAVE!`);
            }, total * 40 + 100);
        } catch (e) {
            console.error('Delete HNs error:', e);
            alert('Error: ' + e.message);
        }
    }

    /*****************************************************************
     * BUTTON STATE MANAGEMENT
     *****************************************************************/
    function updateButtonState() {
        const btn = document.getElementById('delete-hn-btn-v2');
        if (!btn) return;

        const selected = W.selectionManager.getSelectedFeatures();
        const hasSelection = selected && selected.length > 0;

        if (hasSelection) {
            // Active state - red
            btn.style.background = '#c33d3d';
            btn.style.cursor = 'pointer';
            btn.style.opacity = '1';
            btn.disabled = false;
        } else {
            // Inactive state - grey
            btn.style.background = '#808080';
            btn.style.cursor = 'not-allowed';
            btn.style.opacity = '0.6';
            btn.disabled = true;
        }
    }

    /*****************************************************************
     * TOOLBAR BUTTON
     *****************************************************************/
    function addToolbarButton() {
        if (document.getElementById('delete-hn-btn-v2')) return;

        const deleteBtn = document.querySelector('#delete-button');
        const deleteWrapper = deleteBtn?.closest('wz-basic-tooltip');

        if (!deleteWrapper) return;

        const wrapper = document.createElement('wz-basic-tooltip');
        wrapper.innerHTML = `
<wz-tooltip trigger="hover" hide-delay-ms="0">
    <wz-tooltip-source>
        <div class="toolbar-button-wrapper">
<button
    id="delete-hn-btn-v2"
    class="custom-delete-btn"
    type="button"
    style="
        border: none;
        border-radius: 999px;
        color: white;
        font-weight: 600;
        font-size: 14px;
        display: flex;
        align-items: center;
        height: 24px;
        text-shadow: 1px 1px 2px #333;
        padding: 6px 8px;
        opacity: 0.6;
        transition: all 0.2s ease;
    "
    disabled>
    <i class="w-icon w-icon-trash" style="font-size: 14px;"></i>
    <span style="padding-left:2px; padding-top:2px">HN</span>
</button>
        </div>
    </wz-tooltip-source>
    <wz-tooltip-content>Delete House Numbers</wz-tooltip-content>
</wz-tooltip>
`;
        const toolbar = deleteWrapper.parentElement;
        toolbar.insertBefore(wrapper, toolbar.firstChild);

        const btn = wrapper.querySelector('#delete-hn-btn-v2');
        btn.addEventListener('click', deleteHouseNumbers);

        // Update button state initially
        updateButtonState();

        // Listen for selection changes
        W.selectionManager.events.register('selectionchanged', null, updateButtonState);

        console.log(' WME Delete HNs v2 button added');
    }

    /*****************************************************************
     * OBSERVER (handles late load + UI rebuilds)
     *****************************************************************/
    function observeToolbar() {
        const observer = new MutationObserver(() => {
            addToolbarButton();
        });

        observer.observe(document.body, {
            childList: true,
            subtree: true
        });
    }

    /*****************************************************************
     * BOOTSTRAP
     *****************************************************************/
    function bootstrap() {
        if (
            typeof W === 'undefined' ||
            !W.map ||
            !W.model ||
            !W.selectionManager ||
            !W.model.segmentHouseNumbers
        ) {
            setTimeout(bootstrap, 500);
            return;
        }

        console.log(' WME Delete HNs v2 initialized');
        observeToolbar();
    }

    /*****************************************************************
     * START
     *****************************************************************/
    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', bootstrap);
    } else {
        bootstrap();
    }
})();